import { LogoContainer, NavbarContainer, LinksContainer, ListItem } from './styles'
import HomeRoundedIcon from '@mui/icons-material/HomeRounded';
import TimelineRoundedIcon from '@mui/icons-material/TimelineRounded';
import LinkIcon from '@mui/icons-material/Link';
import { NavLink } from 'react-router-dom';
import { useState } from 'react';

interface linkProps {
  id: string
  active: boolean
}

const Navbar = () => {
  const [linksState, setlinksState] = useState<linkProps[]>()

  const manageClassName = (idLink: string) => {
    const idLinks = ['home-navbar', 'campaing-navbar', 'links-navbar']
    for (let i=0; i<idLinks.length; i++) {
      if (idLink === idLinks[i]) {
        document.getElementById(idLink)?.classList.add('active')
      } else {
        document.getElementById(idLink)?.classList.remove('active')
      }
    }
  }

  return(
    <NavbarContainer>
      <LogoContainer>Traceable</LogoContainer>

      <LinksContainer>
        <ListItem id='home-navbar' onClick={() => manageClassName('home-navbar')}>
          <NavLink to='/home'>
            <HomeRoundedIcon style={{ fill: '#ffffff' }}/>
            Home
          </NavLink>
        </ListItem>

        <ListItem id='campaing-navbar' onClick={() => manageClassName('campaing-navbar')}>
          <NavLink to='/campaings'>
            <TimelineRoundedIcon style={{ fill: '#ffffff' }}/>
            Campanhas
          </NavLink>
        </ListItem>

        <ListItem id='links-navbar' onClick={() => manageClassName('links-navbar')}>
          <NavLink to='/home'>
            <LinkIcon style={{ fill: '#ffffff' }}/>
            Meus Links
          </NavLink>
        </ListItem>
      </LinksContainer>        
    </NavbarContainer>
  )
}

export default Navbar
